import './Card.css';
import DeepTable from './DeepTable';

const Table = ({ team, index }) => {

  return (
    <section>
      <article className='table-header'>
      </article>
      {team.table.map((e, key) => <DeepTable e={e} key={key}/>)}
    </section>
  )
};

export default Table;
